import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <div className="navbar glass">
            <div className="navbar-div-title">
                <a href="/"><h1 className="beige">iCONICQUE</h1></a>
                <p className="tan">the hits, reviewed; for <span style={{ fontStyle: "underline" }}>real icons</span> only.</p>
            </div>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                <Link to="/contact">Contact</Link>
            </nav>
        </div >
    );
}

export default Navbar;
